def req_media(media_url):
    data = {
        'spm_id_from': '333.337.search - card.all.click',
        'vd_source': '69181b959bc0cae8de15caffd47134a6'
    }
    res = session.get(media_url, params=data)
    aid = re.search('"aid":(\d+),', res.text).group(1)
    cid = re.search('"cid":(\d+),', res.text).group(1)
    return aid, cid


def req_v2(aid, cid):
    v2_url = 'https://api.bilibili.com/x/player/v2'
    data = {
        'aid': aid,
        'cid': cid,
    }
    session.get(v2_url, params=data)
    session.cookies['CURRENT_FNVAL'] = '4048'


def set_b_lsid():
    t = hex(int(time.time() * 1000)).upper().replace('0X', '')

    s = ''
    for i in range(8):
        s += hex(int(16 * random.random())).upper().replace('0X', '')
    if len(s) < 8:
        s.rjust(8, '0')
    session.cookies['b_lsid'] = s + '_' + t


def set_uuid():
    session.cookies['_uuid'] = str(uuid.uuid4())


def set_buvid4():
    spi_url = 'https://api.bilibili.com/x/frontend/finger/spi'
    res = session.get(url=spi_url)
    b_4 = res.json()['data']['b_4']
    b_4 = quote(b_4)
    session.cookies['buvid4'] = b_4


