def start(aid, cid):
    h5_url = 'https://api.bilibili.com/x/click-interface/click/web/h5'
    data = {
        "aid": aid,
        "cid": cid,
        "part": "1",
        "lv": "0",
        "ftime": int(time.time() * 100),
        "stime": int(time.time() * 100),
        "type": "3",
        "sub_type": "0",
        "refer_url": "",
        "spmid": "333.788.0.0",
        "from_spmid": "333.337.search-card.all.click",
        "csrf": ""
    }
    session.post(h5_url, data=data)


def get_video_id_info(video_url, proxies):
    session = requests.Session()
    bvid = video_url.rsplit('/')[-1]
    res = session.get(
        url="https://api.bilibili.com/x/player/pagelist?bvid={}&jsonp=jsonp".format(bvid),
        proxies=proxies
    )

    cid = res.json()['data'][0]['cid']

    res = session.get(
        url="https://api.bilibili.com/x/web-interface/view?cid={}&bvid={}".format(cid, bvid),
        proxies=proxies
    )
    res_json = res.json()
    aid = res_json['data']['aid']
    view_count = res_json['data']['stat']['view']
    duration = res_json['data']['duration']
    print("\n视频 {}，平台播放量为：{}".format(bvid, view_count))
    session.close()
    return aid, bvid, cid, duration, int(view_count)


def main():
    media_url = 'https://www.bilibili.com/video/BV1N94y1R7K5'
    aid, bvid, cid, duration, view_count = get_video_id_info(media_url, proxies={'http': 'https:127.0.0.1:7890'})
    while True:
        try:
            get_video_id_info(media_url, proxies={'http': 'https:127.0.0.1:7890'})
            aid, cid = req_media(media_url)
            req_v2(aid, cid)
            set_b_lsid()
            set_uuid()
            set_buvid4()
            set_buvid_fp()
            start(aid, cid)
            view_count += 1
            print("理论刷的播放量：", view_count)
        except Exception as e:
            print(e)


if __name__ == '__main__':
    session = requests.session()
    session.headers = {
        'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/104.0.0.0 Safari/537.36'
    }
    main()




